import React, { Component } from "react";

class Nav extends Component {
  render() {
    return (
      <nav>
        <ul>
          <li>TOP</li>
          <li>CONCEPT</li>
          <li>CONTACT</li>
        </ul>
      </nav>
    );
  }
}

export default Nav;
